def prompt(default, text)
  if default == ""
  	print(text + ' ')
  else
  	print(text + ' Default[' + default + '] ')
  end
  result = gets.chomp.strip

  prompt(default,text) if result == "" && default == ""
  return result.empty? ? default : result
end

def file_check
	file = prompt("", "Enter the full path to the file you want to Encode/Decode:")

	if File.exists?(file)
		return file

		# menu_method()
	else
		puts "\n"
		puts "#{file} - file dose not exist!"
		puts "\n"

		file_check()
	end
end

def encode_method(path)
	filePath = path

  # @char.each do |key, value|
  #   # contentsFile = File.open(filePath, "r"){ |file| file.read }
  #   contentsFile = File.read(filePath, :encoding => "utf-8")

  #   new_contents = contentsFile.gsub("#{key}", "#{value}")
  #   # To write changes to the file, use:
  #   File.open(filePath, "w") {|file| file.puts new_contents }
  # end

  contentsFile = File.read(filePath, :encoding => "utf-8")

  new_contents = contentsFile.gsub(Regexp.union(@char.keys), @char)

  File.open(filePath, "w") {|file| file.puts new_contents }


  puts "\n"
  puts "Successfully Encoded!!"
  puts "\n"

  return
end

def decode_method(path)
	filePath = path

  contentsFile = File.read(filePath, :encoding => "utf-8")

  @char_new = @char.invert

  new_contents = contentsFile.gsub(Regexp.union(@char_new.keys), @char_new)

  File.open(filePath, "w") {|file| file.puts new_contents }


  puts "\n"
  puts "Successfully Decoded!!"
  puts "\n"

  return
end

def folder_name
	folder = prompt("", "What is the folder name/path you want to be used?")

	if Dir.exists?(folder)
		return folder
	else
		puts "\n"
		puts "#{folder} - folder dose not exist!"
		puts "\n"

		folder_name()
	end
end

def find_files(folder)
	folder = folder

	folder = folder.gsub("\\", "/")

  allFiles = Dir["#{folder}/**/*.aspx", "#{folder}/**/*.ascx", "#{folder}/**/*.html"]

  return allFiles

  # menu_method()
end

def exit_program
	exit
end

def menu_method
	@menu = ["Encode File", "Decode File", "Encode Folder", "Decode Folder", "Exit"]
	option_num = 1

	puts "Menu:"
	@menu.each { |option| puts "#{option_num}) #{option}"; option_num += 1 }

	@menu_options = prompt("1", "Pick a number from the Menu:").to_i
	puts "\n"

	case @menu_options
	when 1
		file = file_check()

		encode_method(file)
		menu_method()
	when 2
		file = file_check()

		decode_method(file)
		menu_method()
	when 3
		folder = folder_name()
		allFiles = find_files(folder)

		allFiles.each do |path|
	    encode_method(path)
	  end

	  menu_method()
	when 4
		folder = folder_name()
		allFiles = find_files(folder)

		allFiles.each do |path|
	    decode_method(path)
	  end

	  menu_method()
	when 5
		exit_program()
	else
		menu_method()
	end
end

menu_method()

